export default class extends React.Component {
	render() {
		return (
			<div>
				<header>Podcast</header>

				<style jsx>{`
					header {
						color: #fff;
						background: #8756ca;
						padding: 15px;
					}
				`}</style>

				<style jsx global>
					{`
						body {
							margin: 0;
							font-family: system-ui;
							background: black;
						}
						h1 {
							font-size: 20px;
						}
						h2 {
							font-size: 16px;
						}
						p {
							font-size: 12px;
						}
					`}
				</style>
			</div>
		)
	}
}
